import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";


function App() {
  return (
      <div className="App">
        <BrowserRouter>
        <Routes>
        <Route path='/Contact' element={<Contact/>} />
        <Route path='/home' element={<Home/>} />
        <Route path='/details' element={<Details/>} />
        <Route path='/favs' element={<Favs/>} />
        </Routes>
      </BrowserRouter>
          <Navbar/>
          <Footer/>
      </div>
  );
}

export default App;
